import {OrganizationsSvg} from '../Icons/Organizations'
import {CategorySvg} from '../Icons/Category'
import {RadioSvg} from '../Icons/Radio'

export const searchLink = [
    // {
    //     id: 'people',
    //     name: 'people',
    //     icon: PeopleSvg
    // },
    {
        id: 'organization',
        name: 'organization',
        icon: OrganizationsSvg
    },
    {
        id: 'offerings',
        icon: CategorySvg,
        name: 'offerings'
    },
    {
        id: 'stream',
        icon: RadioSvg,
        name: 'live_stream'
    }
]

export const searchLinkForInfoMat = [
    {
        id: 'organization',
        name: 'organization',
        icon: OrganizationsSvg
    }
]
